import React from 'react';
import '../../Styles/News.css';

export default function NewsContent() {
    return(
        <div className="NewsContent">
            <div class="newsbody-info flex-center">
                <div class="newsbody-time" style={{color: '#777'}}>20.10 2016</div>
                <div class="newsbody-cate">Inspiration</div>
            </div>
        </div>
    )
}
